import { CRow } from "@coreui/react";
import { Form } from "react-bootstrap";
import FormInputLabel from "src/Components/UI/Input/FormInputLabel";
const Store = () => {
  return (
    <>
      <Form>
        <CRow>
          <FormInputLabel
            md={6}
            sm={12}
            label="Product Name"
            type="text"
            readOnly={false}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            md={6}
            sm={12}
            label="Price"
            type="text"
            readOnly={false}
            placeHolder="$ 0.00"
          />
        </CRow>
        <CRow>
            <FormInputLabel md={6}
            sm={12}md={6}
            sm={12}  />
        </CRow>
      </Form>
    </>
  );
};
export default Store;
